import { stringify } from "node:querystring";
import { useState } from "react";
import "../styles/componentsStyles/StudentsList.css"

export default function StudentsList() {

    const [ checkedButtons, setCheckedButtons ] = useState([] as any)

    function sayHello (id: string) {
        var buttonNum = document.getElementById(id);

        if(buttonNum?.className === "buttonUncheck") {
            buttonNum?.classList.remove('buttonUncheck')
            buttonNum?.classList.add('buttonCheck')
            setCheckedButtons([...checkedButtons,id]);
            return;
        }

        var oldButtons = checkedButtons;
        var newButtons = oldButtons.filter(x => x != id);
        setCheckedButtons(newButtons);

        buttonNum?.classList.remove('buttonCheck')
        buttonNum?.classList.add('buttonUncheck')

    }

    function testButtonsArr() {
        console.log(checkedButtons);
    }

    return (
        <div className="studentsList">
            <div className="student">
                <img src="https://www.construtoracesconetto.com.br/wp-content/uploads/2020/03/blank-profile-picture-973460_640.png" alt="profileImg"/>
                <p>Name</p>
                <button className="buttonUncheck" onClick={() => sayHello("1")} id="1">X</button>
            </div>
            <div className="student">
                <img src="https://www.construtoracesconetto.com.br/wp-content/uploads/2020/03/blank-profile-picture-973460_640.png" alt="profileImg"/>
                <p>Name</p>
                <button className="buttonUncheck" onClick={testButtonsArr} id="2">X</button>
            </div>
            <div className="student">
                <img src="https://www.construtoracesconetto.com.br/wp-content/uploads/2020/03/blank-profile-picture-973460_640.png" alt="profileImg"/>
                <p>Name</p>
                <button className="buttonUncheck" onClick={() => sayHello("3")} id="3">X</button>
            </div>
            <div className="student">
                <img src="https://www.construtoracesconetto.com.br/wp-content/uploads/2020/03/blank-profile-picture-973460_640.png" alt="profileImg"/>
                <p>Name</p>
                <button className="buttonUncheck" onClick={() => sayHello("4")} id="4">X</button>
            </div>
            <div className="student">
                <img src="https://www.construtoracesconetto.com.br/wp-content/uploads/2020/03/blank-profile-picture-973460_640.png" alt="profileImg"/>
                <p>Name</p>
                <button className="buttonUncheck" onClick={() => sayHello("5")} id="5">X</button>
            </div>
            <div className="student">
                <img src="https://www.construtoracesconetto.com.br/wp-content/uploads/2020/03/blank-profile-picture-973460_640.png" alt="profileImg"/>
                <p>Name</p>
                <button className="buttonUncheck" onClick={() => sayHello("6")} id="6">X</button>
            </div>
            <div className="student">
                <img src="https://www.construtoracesconetto.com.br/wp-content/uploads/2020/03/blank-profile-picture-973460_640.png" alt="profileImg"/>
                <p>Name</p>
                <button className="buttonUncheck" onClick={() => sayHello("7")} id="7">X</button>
            </div>
            <div className="student">
                <img src="https://www.construtoracesconetto.com.br/wp-content/uploads/2020/03/blank-profile-picture-973460_640.png" alt="profileImg"/>
                <p>Name</p>
                <button className="buttonUncheck" onClick={() => sayHello("8")} id="8">X</button>
            </div>
        </div>

    );
}
